INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, 100, 0, 40000, 1, 0, 91002, "", "", 8, 36);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107501, 150, 0, 40001, 1, 1, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", "ぺコリーヌ", 8, 37);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107601, 150, 0, 40001, 2, 1, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", "コッコロ", 8, 38);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107801, 150, 0, 40001, 3, 1, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", "キャル", 8, 39);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107701, 150, 0, 40001, 4, 1, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", "スズメ", 8, 40);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107901, 150, 0, 40001, 5, 1, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", "タマキ", 8, 41);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107501, 150, 0, 40001, 6, 2, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", "ぺコリーヌ", 8, 42);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107601, 150, 0, 40001, 7, 2, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", "コッコロ", 8, 43);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107801, 150, 0, 40001, 8, 2, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", "キャル", 8, 44);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107701, 150, 0, 40001, 9, 2, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", "スズメ", 8, 45);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (107901, 150, 0, 40001, 10, 2, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", "タマキ", 8, 46);
